import React from "react";
import { productlist } from "../ProductDummy";
import SuggestDymmy from "./SuggestDummy";
import styled from "styled-components";
import Slider from "react-slick";
import "slick-carousel/slick/slick.css";
import "slick-carousel/slick/slick-theme.css";

const settings = {
  arrows: false,
  dots: false,
  infinite: true,
  speed: 500,
  slidesToShow: 4,
  slidesToScroll: 2,
};

export default function Suggest() {
  return (
    <SuggestWraper>
      <SuggestBox>
        <SuggestBody>
          <Slider {...settings}>
            {productlist?.map((item) => {
              return (
                <SuggestDymmy
                  text={item.text}
                  url={item.url}
                  price={item.price}
                />
              );
            })}
          </Slider>
        </SuggestBody>
      </SuggestBox>
    </SuggestWraper>
  );
}

export const SuggestWraper = styled.div`
  height: 100%;
  margin-bottom: 30px;
  margin-top: -20px;
`;
export const SuggestBox = styled.div`
  /* width: 1050px;
  margin: 0px auto;
  padding: 40px 0px; */
`;

export const SuggestHead = styled.div`
  margin-bottom: 27px;
  display: flex;
  flex-direction: column;
  -webkit-box-pack: center;
  justify-content: center;
  -webkit-box-align: center;
  align-items: center;

  & div {
    position: relative;
    display: flex;
    padding: 8px 0px 8px 8px;
  }
  & div > span {
    color: rgb(51, 51, 51);
    font-size: 28px;
    line-height: 1.15;
    letter-spacing: -0.26px;
    font-weight: 500;
    text-align: center;
  }
`;

export const SuggestBody = styled.div`
  position: relative;
  width: 1050px;
  margin: 0px auto;
`;
